    false,nt"url": null,nt"notes": "This annual narrative report for Izembek,
    Aleutian Islands, Simeonof, and Semidi NWRs outlines Refuge accomplishments during
    the 1974 fiscal year. The report begins by summarizing the weather conditions and
    habitat conditions during the year. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments. Resource management is outlined; topics include grazing.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses and safety.
    Items of interest and photographs are attached.",nt"license_title": "License
